    def drawDim( self, pt1, pt2, name='aDim', width=2 ):
        global taskUI
        if pt1!=pt2:
            # unit direction vector
            vDir = App.Vector(pt2.sub(pt1))
            uV   = vDir.multiply(1/vDir.Length)
            #setup the contour
